        public int CantidadDeProductos()
        {
            var consulta = EnviarConsulta(0, 0);
            return consulta.total;
            //return 400;
        }

        public bool Actualizar(int offset)
        {
            System.Diagnostics.Debug.WriteLine($"Iniciando Pagina analizada: {offset}");
            var data = EnviarConsulta(offset, 100);
            if (data.productos == null)
            {
                System.Diagnostics.Debug.WriteLine($"Error al obtener pagina: {offset}");
                return false;
            }

            System.Diagnostics.Debug.WriteLine($"Datos obtenidos de Pagina analizada: {offset}, productos {data.productos.Length}");
            var materialesId = new List<string>();
            foreach (var producto in data.productos)
            {
                materialesId.Add(producto.id);
            }
            var materiales = repositorio.Listar<Material>(x => materialesId.Contains(x.Id)).ToList();
            foreach (var producto in data.productos)
            {
                try
                {
                    var material = materiales.FirstOrDefault(x => x.Id == producto.id);
                    if (material == null)
                    {
                        //System.Diagnostics.Debug.WriteLine($"Creando material: {producto.nombre}");
                        string marcaDesc = producto.marca;
                        material = new Material
                        {
                            Activo = true,
                            Id = producto.id,
                            Nombre = producto.nombre,
                            Marca = producto.marca
                        };
                        repositorio.Agregar(material);
                    }
                    //System.Diagnostics.Debug.WriteLine($"Creando precio de material {producto.nombre}");
                    repositorio.Agregar(new Precio
                    {
                        Fecha = DateTime.Now,
                        Material = material,
                        PrecioMaximo = Convert.ToDecimal(producto.precioMax),
                        PrecioMinimo = Convert.ToDecimal(producto.precioMin),

                    });
                }
                catch(Exception e)
                {
                    System.Diagnostics.Debug.WriteLine($"ERROR: {e.StackTrace}");
                }
            }
            
            System.Diagnostics.Debug.WriteLine($"Pagina analizada: {offset}");
            repositorio.GuardarCambios();
            return true;
        }

